script: |
  super -f text -I q7375.spq | sort > q7375.out

inputs:
  - name: q7375.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT 3 + - col0 NOT IN ( 91 + + col2, + col0 * col1 + + + col0, + 24 * col2 * ( 61 ) - CAST ( NULL AS REAL ) );
  - name: tab1

outputs:
  - name: q7375.out
    data: |
